&quot;Though the series delves into heavy subject matter, it does so with a campy humor that deploys plenty of clever word play and sexual innuendo.

Plus, scenes of spell-bindings, conjurings and blood ceremonies are juxtaposed with lectures from the warlocks’ queer theory classes, which inject Brujos with a wokeness that makes it the perfect antidote for today’s political climate.&quot;

