&quot;For many, the concept of the bruja still calls to mind the evil crones or seductresses many of us grew up seeing depicted in childhood folk tales. In these renderings, brujas are malevolent murderesses; women who bring affliction and misfortune. But many feminist scholars have long argued that brujería only developed this negative connotation because Catholic colonizers demonized Afro and Indigenous religious practices, which often centered around female healers. In other words, brujas were so-called because they resisted at a time when colonizers wanted to wipe away their way of life, sexuality, spirituality, and leadership.&quot;

